function ImageCard() {
  return (
    <div style={{ height: "200px" }}>
      <Carousel
        showThumbs={false}
        showStatus={false}
        showIndicators={false}
        infiniteLoop={true}
        autoPlay={false}
        renderArrowPrev={(onClickHandler, hasPrev, label) =>
          hasPrev && (
            <button type="button" onClick={onClickHandler} title={label}>
              {/* 여기에 원하는 화살표 디자인 또는 컴포넌트를 추가 */}
              <img src={prevArrow} alt="Previous" />
            </button>
          )
        }
        renderArrowNext={(onClickHandler, hasNext, label) =>
          hasNext && (
            <button type="button" onClick={onClickHandler} title={label}>
              {/* 여기에 원하는 화살표 디자인 또는 컴포넌트를 추가 */}
              <img src={nextArrow} alt="Next" />
            </button>
          )
        }
      >
        <div>
          <img src={sampleImage1} alt="sample1" style={{ height: "200px" }} />
        </div>
        <div>
          <img src={sampleImage2} alt="sample2" style={{ height: "200px" }} />
        </div>
        <div>
          <img src={sampleImage3} alt="sample3" style={{ height: "200px" }} />
        </div>
      </Carousel>
    </div>
  );
}

export default function TempPage() {
